import React from 'react'
import DepartmentList from './department-list'
import { inject, observer } from 'mobx-react'

const Department = inject('UserAccessManagementStore')
  (observer((props) => {
    return (
      <div>
        <DepartmentList />
      </div>
    )
  }))

export default Department
